import React from 'react';
import Tilt from 'react-tilt'
import NST from './logo.png'
import './Logo.css'

const Logo = () => {
  return (
    <div className='ma4 mt0 center dib'>
    <Tilt className="Tilt" options={{ max : 60 }} style={{ height: 100, width: 100 }} >
      <div className="Tilt-inner pa3"><img src={NST} alt='Brush'/></div>
    </Tilt>
    </div>
  );
}

export default Logo;
